    the Arizona Development Board, the Oil and Gas Association of Arizona, and the Arizona
    Oil and Gas Conservation Commission. Its specific purpose is to set forth accurately,
    briefly and concisely the total picture regarding Arizona's oil, gas and helium
    potential, the general and specific geologic areas, the land and lease situation
    with specific emphasis on federal, State, Fee and Indian lands, the gas and oil
    pipelines, possible new lines, the helium plant coverage and a factual presentation
